function usePathAnimation() {
    const [scope, animate] = useAnimate();
    useEffect(() => {
        const handleAnimate = async () => {
            await animate([
                ["path.arrowbody", { pathLength: 1 }, { duration: 1.2 }],
                ["path.arrowhead", { pathLength: 1 }, { duration: 1 }]
            ], {
                repeat: Infinity,
            })
            handleAnimate()
        }
        handleAnimate()
    }, [])
    return scope
}

